@-moz-document domain("docs.oracle.com") {
    div#BreadCrumbs, div.NavBit, div.header, div.footer {
        display: none !important;
    }
    html body * {
        font-family: 'Roboto', 'Microsoft YaHei', sans-serif !important;
        font-size: 18px !important;
        line-height: 1.5 !important;
    }
    li p tt {
        font-family: 'Inconsolata', 'Microsoft YaHei', monospace !important;
        font-size: 1.0em !important;
        line-height: 1.5 !important;
    }
    p {
        font-family: 'Roboto', 'Microsoft YaHei', sans-serif !important;
        font-size: 1.0em !important;
        line-height: 1.5 !important;
    }
    pre,
    code {
        font-family: 'Inconsolata', 'Microsoft YaHei', monospace !important;
        font-size: 1.0em !important;
    }
}
